import { createSelector } from "reselect";

const selector = (state) => state.router.location.pathname;
const menusSelector = (state) => state.menus;

export const getMenus = createSelector(
  [menusSelector],
  state => state.list
)

export const getMenusId = createSelector(
  [selector],
  state => state
)
